import css from '../filmCard/PositionsList.module.css';

export function PositionsList({ chord }) {
  console.log(chord.positions);
  // return chord.positions.map((pos) => console.log(pos));
}

function createFret(string, fret) {
  // let markup = ``;
  for (let i = 0; i < fret; i++) {
    return (
      <tr className={css.fret}>
        <td>{string === 1 ? 'X' : '0'}</td>
        <td>{string === 2 ? 'X' : '0'}</td>
        <td>{string === 3 ? 'X' : '0'}</td>
        <td>{string === 4 ? 'X' : '0'}</td>
        <td>{string === 5 ? 'X' : '0'}</td>
        <td>{string === 6 ? 'X' : '0'}</td>
      </tr>
    );
    // console.log(markup);
  }
}
